import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Container, Row, Col} from 'react-bootstrap';
import NavigationBar from './components/NavigationBar';
import Footer from './components/Footer';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'; 
import Student from './components/Student/Student';
import StudentList from './components/Student/StudentList';
import Instructor from './components/Instructor/Instructor';
import InstructorList from './components/Instructor/InstructorList';


function App() {

  const marginTop = {
    marginTop: "20px"
  };

  return (
    <Router>
      <NavigationBar/>
        <Container>
          <Row>
            <Col lg ={12} style={marginTop}>
              <Switch>
                <Route path = "/students"exact component = {StudentList}/>
                <Route path = "/add-student"exact component = {Student}/>
                <Route path = "/instructor"exact csomponent = {Instructor}/>
                <Route path = "/instructors"exact component = {InstructorList}/>


              </Switch>
            </Col>
          </Row>
        </Container>
      <Footer/>
    </Router>
  );
}



export default App;
